import React from 'react'

import { PageWrapper, CopyContainer, Title } from './styledComponents'

export const OurStory = () => {
	return (
		<PageWrapper>
			<CopyContainer>
				<Title>Our Story</Title>
			</CopyContainer>
		</PageWrapper>
	)
}
